// Get the InvoiceId passed from the process
var invoiceId = Get<Guid>("InvoiceId");
if (invoiceId.Equals(Guid.Empty)) {
    return true; // Exit if no ID was passed
}

// --- 1. FIND THE PRINTABLE TEMPLATE ID ---
// Replace this with the actual ID of your printable template from the "Printables" lookup.
var templateId = new Guid("4fb5a518-b49d-d731-a833-d65bbbc99f5c"); 

// --- 2. GENERATE THE PDF REPORT ---
// Use the ReportService to generate the PDF from the template and the record
var reportService = UserConnection.FindService<IReportService>();
var reportData = reportService.GenerateMSWordReport(templateId, invoiceId);

if (reportData == null || reportData.Length == 0) {
    // You can add error handling here, like logging a message
    return true; // Exit if the report failed to generate
}

// --- 3. PREPARE THE EMAIL ACTIVITY ---
// Read the Invoice to get dynamic data like the Contact's email
var invoiceESQ = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "Invoice");
invoiceESQ.AddColumn("Number");
invoiceESQ.AddColumn("Contact.Email");
var invoiceEntity = invoiceESQ.GetEntity(UserConnection, invoiceId);

if (invoiceEntity == null) {
    return true; // Exit if invoice not found
}

string recipientEmail = invoiceEntity.GetTypedColumnValue<string>("Contact_Email");
string invoiceNumber = invoiceEntity.GetTypedColumnValue<string>("Number");

if (string.IsNullOrEmpty(recipientEmail)) {
    // Handle cases where the contact has no email
    return true; 
}

// Create a new Activity entity for the email
var emailActivity = UserConnection.EntitySchemaManager.GetInstanceByName("Activity").CreateEntity(UserConnection);
emailActivity.SetDefColumnValues();

// Set the email properties
emailActivity.SetColumnValue("TypeId", new Guid("E2831DEC-CFC0-4372-B333-6E1D864239A4")); // Email Type ID (constant)
emailActivity.SetColumnValue("Title", "Your Invoice: " + invoiceNumber);
emailActivity.SetColumnValue("Body", "Dear Customer,\n\nPlease find your invoice attached.\n\nBest regards,\nYour Company");
emailActivity.SetColumnValue("Recepient", recipientEmail); // Note the typo in Creatio's schema: "Recepient"
emailActivity.SetColumnValue("InvoiceId", invoiceId); // Link the email to the invoice
emailActivity.SetColumnValue("Sender", "noreply@yourcompany.com"); // Set the sender's email
emailActivity.Save();

Guid createdActivityId = emailActivity.GetTypedColumnValue<Guid>("Id");

// --- 4. ATTACH THE GENERATED PDF TO THE EMAIL ACTIVITY ---
// Create the ActivityFile entity
var activityFile = UserConnection.EntitySchemaManager.GetInstanceByName("ActivityFile").CreateEntity(UserConnection);
activityFile.SetDefColumnValues();
activityFile.SetColumnValue("Name", "Invoice-" + invoiceNumber + ".pdf");
activityFile.SetColumnValue("Data", reportData); // The PDF byte array
activityFile.SetColumnValue("ActivityId", createdActivityId); // Link to the email
activityFile.SetColumnValue("TypeId", new Guid("529BC2F8-0EE0-DF11-971B-001D60E938C6")); // File Type ID (constant)
activityFile.Save();

// --- 5. PASS THE EMAIL ACTIVITY ID TO THE NEXT PROCESS STEP ---
Set("EmailActivityId", createdActivityId);

return true;
